import React from 'react';
import { Route, Routes } from 'react-router-dom'
//import Header from './components/Header';
import CovidVideos from './components/covidVideos';
import OtherVideos from './components/otherVideos';
const App = () =>{
    return(

        <Routes>
            <Route exact path="/" component={<CovidVideos />} />
            <Route path="/otherVideos" component={<OtherVideos/>} />
        </Routes>
    );
}
export default App;
